from collections import defaultdict


def sum_for_list2(lst):
    max_prime = max(max(lst), -min(lst))
    primes = []
    result = []
    for i in range(2, max_prime+1):
        for prime in primes:
            if not i % prime:
                break
        else:
            primes.append(i)
            summ = 0
            is_divisible = False
            for val in lst:
                if not val % i:
                    summ += val
                    is_divisible = True
            if is_divisible:
                result.append([i, summ])
    return result


def sum_for_list(lst):

    prod = 1
    for val in lst:
        prod *= val
    prod = abs(prod)

    primes = []
    i = 2
    while prod > 1:
        if not prod % i:
            primes.append(i)
            while not prod % i:
                prod = prod // i
        i += 1
    return [[prime, sum(x for x in lst if not x % prime)] for prime in primes]


def sum_for_list3(lst):
    def factors(x):
        p_facs = []
        i = 2
        while x > 1 or x < -1:
            if x % i == 0:
                p_facs.append(i)
                x //= i
            else:
                i += 1
        return list(set(p_facs))

    fac_dict = defaultdict(int)

    for i in lst:
        for fac in factors(i):
            fac_dict[fac] += i

    return sorted([[k, v] for k, v in fac_dict.items()])


